import React, {Component} from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import {Container, Navbar, Nav} from "react-bootstrap";

class Headers extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
    };

    render() {
        return (
            <Navbar fixed="top" expand="lg" collapseOnSelect bg="dark" variant="dark">

                <Nav className="mr-auto">
                    <ul className="nav-items">
                        <li className="nav-item">
                            <Link
                                activeClass="active"
                                to="section1"
                                spy={true}
                                href="#home"
                                smooth={true}
                                offset={-70}
                                duration={1000}
                            >Section 1</Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                activeClass="active"
                                to="section2"
                                spy={true}
                                smooth={true}
                                offset={-70}
                                duration={1000}
                            >
                                Section 2
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                activeClass="active"
                                to="section3"
                                spy={true}
                                smooth={true}
                                offset={-70}
                                duration={1000}
                            >
                                Section 3
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                activeClass="active"
                                to="section4"
                                spy={true}
                                smooth={true}
                                offset={-70}
                                duration={1000}
                            >
                                Section 4
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                activeClass="active"
                                to="section5"
                                spy={true}
                                smooth={true}
                                offset={-70}
                                duration={1000}
                            >
                                Section 5
                            </Link>
                        </li>
                    </ul>
                </Nav>
            </Navbar>
        )
    }
}


export default Headers;
